import './App.css';

import {List} from "./List";
function App() {
  const planets = [
    {name: "mars", isplanet:true},
    {name: "earth", isplanet:false},
    {name: "neptune", isplanet:true},
    {name: "venums", isplanet:false},
    {name: "mercury", isplanet:true}
]
return (
  <div align = "center">{planets.map((value, key) => {
    return <List obj = {planets.value} />
  })}</div>
)
}

export default App;
